  [],\n\t\"revision_timestamp\": \"2016-07-27T22:58:07.358084\",\n\t\"name\": \"fire-management-plan-north-tract-unit-8-patuxent-research-refuge-2005\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"North Tract Unit 8 (NT -8, Drop Zone) is
  a grassland unit composed of a mixture of dense, cool season grass dominated by
  Tall Fescue and a woody legume, Korean Lespedeza. Both plant species are non-native
  and very invasive Topography is slightly rolling. This unit has been managed in
  the past by mowing and planting agricultural cover crops such as corn for wildlife
  management purposes. A 16' wide gravel road with 8' wide mowed edges forms the perimeter
  of this bum unit along the northern flank. Twelve foot wide gravel roads through
  the woods provide fire breaks along the eastern, western, and southern flanks. These
  road features will serve as control lines, avoiding resource disturbance which might
  occur with constructed lines, and is consistent with the Refuge Fire Management
  Plan. Additionally, 12' wide mowed lanes in NT-8 will serve as control lines to
  separate burned from non-burned units within the field.\",\n\t\"license_title\":
